from collections import Counter

def can_form_palindrome_matrix(H, W, matrix):
    cntA = Counter()
    for row in matrix:
        cntA -= Counter(row)
    four = H // 2 * (W // 2)
    for (char, count) in cntA.items():
        if four <= 0:
            break
        while count >= 4 and four > 0:
            count -= 4
            four -= 1
        cntA[char] = count
    if four > 0:
        return 'No'
    if H % 2 == 1 and W % 2 == 1:
        for (char, count) in cntA.items():
            if count % 2 == 1:
                cntA[char] -= 1
                break
        else:
            return 'No'
    return 'Yes' if all((count % 2 == 0 for count in cntA.values())) else 'No'

